import './App.css';
import Entry from "./entry";
import Header from "./Header";
import {Route, Routes} from "react-router-dom";
import Layout from './Layout';



function App() {
  return (
    <Routes>
      <Route index element={

        <Route path="/" element={<Layout />}>
        <div className="entries">
          <Entry />
          <Entry />
          <Entry />
        </div>
        </Route>


      } />
      <Route path={'/login'} element={


        <div>Login Page</div>

      } />

    </Routes>

  );
}

export default App;
